import { Link } from "react-router-dom";
import React, { useState } from "react";
import Carousel from "react-bootstrap/Carousel";
import toolfix from "../images/banners/Tool-&-Fixture-v2.jpg";

const ToolAndFixtureDesign = () => {
  { window.scrollTo({ top: 0, behavior: 'smooth' }); };
  
  const [activeTab, setActiveTab] = useState('tab1');
 
  const tabs = [
    {
        id: 'tab1',
        label: 'Level 1 Certification',
        content: (
            <>
                <div className="row">

                    <div className="col-lg-6"> {/* Adds left offset */}
                        {/* <h2 style={{color: "#000",}}> And Fixture Design:-</h2> */}
                        
                        <h2 style={{ color: "rgb(224 120 44)", }}>Tool  <span style={{ color: "#fff" }}>And Fixture Design </span></h2>  
                        <div  style={{ height: '100%', width:"10%",marginTop:"-150px", marginLeft:"109px" }}>
                        <Link to="/enroll">
                            <button class="btn btn-primary" style={{ marginTop: '109px', width: "138%", background: "#e0782c",marginLeft:"380px" }}>
                                <span>ENROLL</span>
                            </button>
                        </Link>
                    </div>
                        <ul style={{
                            color: "#fff",
                            fontSize: "20px",
                            textAlign: "justify"
                        }}>
                            <li>Explore the essential principles of designing and fabricating tools and fixtures to optimize manufacturing processes.</li>
                            <li>Learn to choose materials based on their characteristics to optimize performance, durability, and cost.</li>

                        </ul>

                    </div>
                  



                </div>
                <div className="row">
                    <div className=""> {/* Adds left offset */}
                        <p style={{
                            color: "#fff",
                            fontSize: "20px",
                            textAlign: "justify",
                            marginTop:"35px",
                        }}>Welcome to the Tool and Fixture Design course at IIA. This comprehensive program is designed to equip students with the knowledge and skills required to design efficient and effective tools and fixtures for various manufacturing processes. From concept to implementation, this course covers the entire spectrum of tool and fixture design principles.Tool and fixture design stands as a cornerstone in manufacturing, ensuring, efficiency, precision and consistency in production processes. These designs, meticulously crafted by engineers, provide the foundation for the creation of various components and products. Precision in tool and fixture design is paramount, as it directly impacts the quality and uniformity of the end products.</p>


                    </div>
                </div>

            </>
        )
    },
    // {
    //     id: 'tab2',
    //     label: 'Level 2 Certification',
    //     content: (
    //         <>
    //             <div className="row">


    //                 <div className="col-lg-6"> 
    //                     <h2 style={{ color: "rgb(224 120 44)", }}>Advance Tool   <span style={{ color: "#fff" }}>And Fixture Design </span></h2>
    //                     <div  style={{ height: '100%', width:"10%",marginTop:"-150px", marginLeft:"109px" }}>
    //                     <Link to="/enroll">
    //                         <button class="btn btn-primary" style={{ marginTop: '109px', width: "138%", background: "#e0782c",marginLeft:"380px" }}>
    //                             <span>ENROLL</span>
    //                         </button>
    //                     </Link>
    //                 </div>
    //                     <ul style={{
    //                         color: "#fff",
    //                         fontSize: "20px",
    //                         textAlign: "justify"
    //                     }}>
    //                         <li>Explore the essential principles of designing and fabricating tools and fixtures to optimize manufacturing processes.</li>
    //                         <li>Learn to choose materials based on their characteristics to optimize performance, durability, and cost.</li>
                            
    //                     </ul>

    //                 </div>
                  
    //             </div>
    //             <div className="row">
    //                 <div className=""> {/* Adds left offset */}
    //                     <p style={{
    //                         color: "#fff",
    //                         fontSize: "20px",
    //                         textAlign: "justify"
    //                     }}>Welcome to the Tool and Fixture Design course at IIA. This comprehensive program is designed to equip students with the knowledge and skills required to design efficient and effective tools and fixtures for various manufacturing processes. From concept to implementation, this course covers the entire spectrum of tool and fixture design principles.Engineers meticulously analyze factors like material properties, forces involved and manufacturing constraints to create designs that optimize production speed, accuracy and safety. Through careful consideration of these elements, tool and fixture designs streamline manufacturing operations, reduce errors and enhance overall productivity.</p>



    //                 </div>
    //             </div>
    //         </>
    //     )
    // },
];
const currentTab = tabs.find(tab => tab.id === activeTab);
  return (
    <div>
 <section style={{ marginTop: "10px", marginLeft: '153px', marginRight: '178px' }}>
  <Carousel className="res-nav-mob no-indicators" interval={300000} controls={false} indicators={false}>
    <img className="d-block w-100" src={toolfix} alt="Tool & Fixture Design" style={{ height: "600px", width: "90%" }} />
    <Carousel.Caption style={{ width: "100%", textAlign: "left", display: "flex", flexDirection: "column", justifyContent: "center", height: "100%" }}>
      <div className="row" style={{ alignItems: "flex-start", height: "100%" }}>
        <div className="col-lg-8 dtd" style={{ display: "flex", flexDirection: "column", justifyContent: "center", marginBottom: "240px" }}>
          <div style={{ display: "flex", alignItems: "flex-start", justifyContent: "space-between", marginBottom: "20px" }}>
            <h2 
              className="banner-content"
              style={{
                fontFamily: "Roboto", 
                fontSize: "40px", 
                fontWeight: "800", 
                marginTop:"30px",
                color: "#fff",
                width: "100%", // Takes up half of the row
                marginLeft:'-100px' // Remove any default margins
              }}
            >
              TOOL & FIXTURE <span style={{ color: "#F58842" }}>DESIGN</span>
            </h2>
            
            <h2 
              className="banner-content"
              style={{
                fontFamily: "Poppins, SansSerif", 
                fontSize: "32px", 
                fontWeight: "600", 
                marginTop:"30px",
                color: "#fff",
                width: "100%", // Takes up half of the row
                textAlign: "right", // Aligns text to the right within its column
                marginLeft: "30px", // Add space between headings
                marginRight:'-100px'
              }}
            >
              Unlock your potential in manufacturing "From Concept to Creation"
            </h2>
          </div>

          <div style={{ marginTop: "80px", textAlign: "center" }}> {/* Add some space below the headings */}
            <p className="banner-contentul" style={{ fontSize: "17px", color: "#fff", textAlign: "justify", textIndent: "50px", fontWeight: "bold" }}>
              1. Industrial Oriented Training (IOT)
            </p>
            <p className="banner-contentul" style={{ fontSize: "17px", color: "#fff", textAlign: "justify", textIndent: "50px", fontWeight: "bold" }}>
              2. Job Oriented Skill Enhancement (JOSE)
            </p>
            <p className="banner-contentul" style={{ fontSize: "17px", color: "#fff", textAlign: "justify", textIndent: "50px", fontWeight: "bold" }}>
              3. 100% Placement Support
            </p>
            <p className="banner-contentul" style={{ fontSize: "25px", color: "#fff", textAlign: "justify", fontWeight: "bold", marginLeft: "49px" }}>
              NX & CATIA Software free training
            </p>
          </div>
          <button
  style={{
    backgroundColor: rgb(82, 77, 161),
    color: "#fff", // White text color
    border: "none",
    width:"240px",
    borderRadius: "5px", // Rounded corners
    padding: "10px 20px", // Padding around the text
    fontSize: "16px", // Font size
    cursor: "pointer", // Cursor changes to pointer on hover
    marginTop: "50px", // Space above the button
  }}
  onClick={() => {
    // Add your download logic here
    console.log("Download brochure clicked");
  }}
>
  Download Brochure
</button>

        </div>
      </div>
    </Carousel.Caption>
